import React, { useState } from "react";
import "./NavBar.css";
import logo from "../assets/logo.png";
import cart from "../assets/cart_icon.png";

const NavBar = () => {
  const [current, setCurrent] = useState("shop");
  return (
    <div className="navbar">
      <div className="nav-logo">
        <img src={logo} alt="medevs" />
        <p>Medecom</p>
      </div>
      <ul className="nav-menu">
        <li onClick={() => setCurrent("shop")}>
          Shop {current === "shop" && <hr />}
        </li>
        <li onClick={() => setCurrent("men")}>
          Men {current === "men" && <hr />}
        </li>
        <li onClick={() => setCurrent("women")}>
          Women {current === "women" && <hr />}
        </li>
        <li onClick={() => setCurrent("kids")}>
          {" "}
          Kids {current === "kids" && <hr />}
        </li>
      </ul>
      <div className="nav-login-cart">
        <button>Login</button>
        <img src={cart} alt="" />
        <div className="nav-cart-count">0</div>
      </div>
    </div>
  );
};

export default NavBar;
